    formatDate(date) {
        var d = new Date(date), month = '' + (d.getMonth() + 1), day = '' + d.getDate(), year = d.getFullYear();
        if (month.length < 2)
            month = '0' + month;
        if (day.length < 2)
            day = '0' + day;
        return [year, month, day].join('-');
    }
    ngOnInit() {
        document.querySelector(".preloader").style.cssText = "display:inline-block;";
        this.dataService.get_list(this.docname, ["*"], [["docstatus", "=", "1"], ["fin_de_publicación", ">", this.formatDate(new Date())]]).subscribe(data => {
            let resp = data["data"];
            this.cur_doc = resp;
            document.querySelector(".preloader").style.cssText = "display:none;";
        });
        this.dataService.get_list_name_limit("Nombre de carrera", ["name", "nombre"], 250).subscribe(data => {
            let resp = data["data"];
            this.carreras = resp;
        });
    }
